[!NOTE] Do not read this section, open up your editor and run all of these programs and transcribe them into your notes Variables In Rust variables are declared with the let statement, the type of the variable is inferred by the compiler if it is defined in the function, however, it can be explicitly declared and in some situations this is necessary. fn main() { let x = 5; // x is an integer let y: i32 = 6; // y is an integer let z: f32 = 7.0; // z is a float let Xs: Vec<i32> = vec![1, 2, 3, 4, 5]; // Xs is a vector of integers
} x = 5 # x is an integer
y: int = 6 # y is an integer
z: float = 7.0 # z is a float
Xs: List[int] = [1, 2, 3, 4, 5] # Xs is a list of integers Control Flow Conditionals If Tests If Tests in python and rust are quite similar: let x = 6;
if x % 2 == 0 { println!("x is even.");
} else { println!("x is odd.");
} let mut counter = 0;
while counter < 5 { println!("{}", counter); counter += 1;
} for num in 1..=5 { println!("{}", num);
} x = 6 if x % 2 == 0: print("x is even.")
else: print("x is odd.") counter = 0
while counter < 5: print(counter) counter += 1 for num in range(1, 6): print(num) Enums Rust relies heavily on Enum's, a type that can represent one of several values, this is useful for representing states, e.g. a traffic light. In Rust, enums are defined with the enum keyword and in Python they are defined with the enum module. // Define an enum
enum TrafficLight { Red, Yellow, Green,
} fn action(light: &TrafficLight) { match light { TrafficLight::Red => println!("Stop!"), TrafficLight::Yellow => println!("Ready!"), TrafficLight::Green => println!("Go!"), }
} fn main() { // Use the enum in a match statement let stop_light = TrafficLight::Red; action(&stop_light); // Outputs: Stop!
} /home/ryan/Studies/Teaching/2024/uhe/it2000_software_development/mdbook/src/programming-fundamentals.md from enum import Enum class TrafficLight(Enum): Red = "Stop!" Yellow = "Stop if Able" Green = "Go!" def action(light: TrafficLight): match light: case TrafficLight.Red: print(light.value) case TrafficLight.Yellow: print(light.value) case TrafficLight.Green: print(light.value) def main(): # Use the enum in a match statement stop_light = TrafficLight.Red action(stop_light) # Outputs: Stop! Pass by Reference, Value and Move Basic Declaration The following example declares some variables in rust let x = 6; // x cannot be changed
let mut y = 7; // y can be changed
y = 4; // this is fine This example extends that to a vector: // This x_vec cannot be changed as we didn't use mut
let x_vec: Vec<i32> = vec![1, 2, 3, 4, 5]; // These braces create a new scope
{ // This is another variable called x_vec that obscures the first let x_vec: Vec<i32> = vec![6, 7, 8, 9, 10]; println!(x_vec); // This will print the second x_vec
} println!(x_vec); // This will print the first as the second is out of scope Disambiguation -- Mutable and Immutable In python there are mutible and immutable types, this doesn't mean you can't change the value of a variable, rather, it means that a copy of that variable is made when it is passed to a function or method. It's immutable in the sense that the underlying data cannot be changed but is instead overwritten. Simple types like int and float are copied into a function (immutable) but aggregate types like list and dict are passed by reference (mutable), meaning the function will change the outside data. In Rust, mutability via the mut keyword changes a variable from read only to read/write, so in practice it has a different meaning for the developer. However, a similar concept is at play for aggregate types like Vec<> and HashMap<>, these types are neither copied into a function or passed by reference, they are physically moved into that function and access to the is lost. In addition Rust can also copy into a function by using the .clone() method and pass by reference by using & and * symbols When a variable is sent to a function in Rust, it is moved into that function and we no longer have access to it. In Python a link to that variable goes to the function This doesn't happen for simple data types like int / i32 and float / f32 , those are simply copied, but it does happen for Vectors. Similarly in Python, simple types like int and float Pass by Reference In this example, Rust moves the variable into the function print_sum() fn print_sum(som_val: Vec<i32>) { total: i32 = som_val.iter().sum() println!("{}", total);
} fn main() { // This x_vec cannot be changed as we didn't use mut let x_vec: Vec<i32> = vec![1, 2, 3, 4, 5]; // This x_vec is totally different and hides the first variable name let x_vec: Vec<i32> = vec![6, 7, 8, 9, 10]; // If we print the sum, it will use the second x_vec print_sum(x_vec); // Now the second x_vec has been moved into print_sum, // which that function finished, it deleted all it's variables // This is now the first one print_sum(x_vec); // Now we have no variables in scope so this will fail print_sum(x_vec); } In Python, the list is passed by reference, so the function will change the outside data: def replace_first_val(x_vec: List[int]) -> List[int]: x_vec[0] = 6 return x_vec def main(): # Define x_vec x_vec: List[int] = [1, 2, 3, 4, 5] # x_vec is not copied or moved, it is passed by reference replace_first_val(x_vec) # This will print the first x_vec print(x_vec) # [6, 2, 3, 4, 5] In Rust, the & symbol must be used to explicitly show the variable is going to change: fn replace_first_val(x_vec: &mut Vec<u32>) { x_vec[0] = 6;
} fn main() { // Define x_vec let mut x_vec: Vec<u32> = vec![1, 2, 3, 4, 5]; // x_vec is not copied or moved, it is passed by reference replace_first_val(&mut x_vec); // This will print the first x_vec println!("{:?}", x_vec); // [6, 2, 3, 4, 5] println!("{:?}", &(x_vec.clone()));
} In C, and C++ a similar symbol is used and it is said to create a pointer , in Rust the function is said to borrow the variable, in Python the function is said to reference the variable. Borrowing the variable in Rust creates a set of rules the variable must follow in order to ensure memory safety, for example, a variable cannot be borrowed mutably and then later borrowed immutably, for example the below code would not compile: fn replace_first_val(x_vec: &mut Vec<u32>) { x_vec[0] = 6;
} fn print_total(x_vec: &Vec<u32>) { let total: u32 = x_vec.iter().sum(); println!("Sum of all elements: {}", total);
} fn main() { // Define x_vec let mut x_vec: Vec<u32> = vec![1, 2, 3, 4, 5]; // x_vec is not copied or moved, it is passed by reference replace_first_val(&mut x_vec); // Now, the vector can be passed by (immutable) reference to print_total() print_total(&x_vec); // Also, we can print the vector itself println!("Updated Vector: {:?}", x_vec);
} This is because the print_total() only has read-only rights and cannot claim read-write privileges. This helps to catch mistakes, in C and C++ this can be a common source of bugs, for example the print_total() function should never modify the array, but is allowed, e.g. in C: #include <stdio.h>
#include <stdlib.h> // Define the size of the array
#define SIZE 5 void replace_first_val(unsigned int *x_array) { // Replace the first element with 6 x_array[0] = 6;
} void print_total(unsigned int *x_array) { // Change the first value replace_first_val(x_array); // Calculate the sum of all elements unsigned int total = 0; for (int i = 0; i < SIZE; ++i) { total += x_array[i]; } printf("Sum of all elements: %u\n", total);
} int main() { // Define x_array unsigned int x_array[SIZE] = {1, 2, 3, 4, 5}; // Print the total print_total(x_array); // Also, we can print the array itself printf("Updated Array: "); for(int i = 0; i < SIZE; i++) { printf("%u ", x_array[i]); } printf("\n"); return 0;
} In rust, we must refactor the code: fn replace_first_val(x_vec: &mut Vec<u32>) { x_vec[0] = 6;
} fn print_total(x_vec: &Vec<u32>) { let total: u32 = x_vec.iter().sum(); println!("Sum of all elements: {}", total);
} fn main() { // Define x_vec let mut x_vec: Vec<u32> = vec![1, 2, 3, 4, 5]; // x_vec is not copied or moved, it is passed by reference replace_first_val(&mut x_vec); // Now, the vector can be passed by (immutable) reference to print_total() print_total(&x_vec); // Also, we can print the vector itself println!("Updated Vector: {:?}", x_vec);
} This is a potential downside to rust, although the code is often more robust, it blocks potential solutions that are valid. For this reason some modern languages, e.g. Zig, do not take this borrow-checker approach. Clones In Rust the .clone() method would make a copy and in python copy.deepcopy() would be used to make a copy. TODO Functions TODO Data Structures TODO Basic Object-Oriented Programming TODO Exception Handling TODO Standard Library TODO Packages Overview

